.
.
Engaging in one-sided transactions such as stealing from others for personal gain -  is ultimately bad for both the selfish person, who will eventually have to face the consequences of their actions and for the people victimised or exploited by that person.
.
.
Neutral selfishness on the other hand, involves prioritising your own wellbeing in ways that do not directly affect others, neither taking away from anybody elseâ€™s wellbeing, nor adding to it. Some would argue that time spent in self care could be better invested in helping others, but it is important to consider how much help we can be to those around us if we don't look after our own physical and psychological health first.
.
.
Some activities, such as a walk with a friend or performing in a theatre production, require the participation of more than one person. As long as all involved are willing participants who are gaining in some way from these two-sided transactions, they can be viewed as good selfishness or interactions that are good for both people.
.
.
Saying no can be a challenge, particularly for the people pleasers among us, but the temporary discomfort can often lead to greater freedom to â€˜beâ€™ in the longer run. 
.
.
It is true that there is a very fine line between self-care, selflessness and selfishness, but as a rule of thumb, getting it right by trial and error, establishing boundaries and maintaining a healthy balance, will eventually allow growth, development and fulfilment of potential, without negative impact on self or anyone else. Surely that is worth standing up for. 
.
.
